INSERT INTO `v1_83bf25536c391e5320922854d1592d3b4fe5c88ceb7215f657ced4794784cd97` VALUES (11, 1, 82013, "その頃わたくしは、\nスカウトをお受けしておりました。\nミサト様いわく、わたくしには保育士の\n『天賦の才』があるそうで。", 1, 10, 0, 82, 0, 1, 0);
