INSERT INTO `v1_83bf25536c391e5320922854d1592d3b4fe5c88ceb7215f657ced4794784cd97` VALUES (11, 1, 82017, "小さいお子様はともかく、動物さんに\n好かれる自覚はありますし……\n冒険者という仕事に不向きなことも、\n自認していますけれど……", 1, 10, 0, 82, 0, 1, 0);
