INSERT INTO `v1_83bf25536c391e5320922854d1592d3b4fe5c88ceb7215f657ced4794784cd97` VALUES (11, 1, 82021, "それでも……適性など踏み越えて、\n己の道を突き進むのが冒険者です。\n一度決めたことを、\n曲げるわけには参りません……！", 1, 10, 0, 82, 0, 1, 0);
